import React from "react";
import { FAQservice } from "../data";
import { Link } from "react-router-dom";

const InfoCar = () => {
  return (
    <div className="flex justify-center items-center h-[100vh] w-[100wh] ">
      <div className=" w-[270px] relative flex flex-col items-center">
        <div className="absolute bg-bg_img bg-no-repeat bg-cover bg-center w-[320px] h-[239px] z-[-1] top-[60px] left-[-25px]"></div>
        <div className="text-main-white text-[28px] text-center mb-[25px] font-bold">
          FAQ СЕРВИС/
          <br />
          ИНФОРМАЦИЯ О<br /> МАШИНЕ
        </div>
        <form className="flex items-center w-[270px] h-[31px] bg-[#D9D9D9] rounded-2xl">
          <span className="bg-search bg-center bg-no-repeat bg-cover w-[24px] h-[20px] mx-3"></span>
          <input className="w-full text-black mr-3" type="text" />
        </form>
        {FAQservice.map((el) => (
          <button className=" w-full  text-main-white text-base text-center font-bold bg-[linear-gradient(45deg,_#264404_29%,_#396904_100%)] hover:bg-[linear-gradient(45deg,_#264404_29%,_#396904_70%)] py-3 px-16 rounded-2xl ">
            {" "}
            <a target="blank" href={el.url}>
              {el.buttonName}
            </a>
          </button>
        ))}
      </div>
    </div>
  );
};

export default InfoCar;
